import React from 'react'

class App extends React.Component {
  constructor () {
    super()
    this.state = {
      toggle: true
    }
  }

  handleChane () {
    this.setState({
      toggle: !this.state
    })
  }

  render () {
    return (
      <div>
        <h1>The main page</h1>
        <button onClick={() => this.handleChane()}>Change the Username</button>
        <h1>The User Page</h1>
        <p>User Name: {(this.state.toggle) ? 'Max' : 'Anna'} </p>
      </div>
    )
  }
}

export default App
